import React from "react";
import './style.css';

export default function Gallery(image, title) {
  return (
    <div className="gallery">
      <h1>Anime Gallery</h1>
      <div className="gallery-grid">
        <img src={image} alt={title+ "pic"} />
        <h1>{title}</h1>
      </div>
    </div>
  );
}
